from typing import *
def f_gold(cuboids: List[List[int]]) -> int:
    for c in cuboids:
        c.sort()
    cuboids.sort()
    n = len(cuboids)
    dp = [0] * n
    for i in range(n):
        for j in range(i):
            if cuboids[j][1] <= cuboids[i][1] and cuboids[j][2] <= cuboids[i][2]:
                dp[i] = max(dp[i], dp[j])
        dp[i] += cuboids[i][2]
    return max(dp)
```

